} from "react-router-dom";

class Home extends Component {
    render() {
        return (
            <div>
                <NavLink to="/test1">tes1</NavLink>
                <NavLink to="/test2"></NavLink>

                Trang chủ nè

            </div>
        );
    }
}

export default Home;
